import React, { Component } from "react";
import { WiThermometer, WiNightSnow } from "react-icons/wi";

import { ProgressBar } from "react-bootstrap";
import Favority from "./amenu/Favority";

const now = 70;
const precipitation = 25;

const progressInstance = (
  <ProgressBar now={now} variant="warning" className="pt w-75 ml-4" />
);

const precipitationInstance = (
  <ProgressBar now={precipitation} variant="warning" className="pt w-75 ml-4" />
);

class Amenu extends Component {
  render() {
    return (
      <div className="amenu ">
        <div className="tests ml-3">
          <h5 className="meteoText my-4">
            <WiThermometer className="thermo-size" />
            METEOROLOG
          </h5>
        </div>
        <hr className="hr mb-5" />
        <section></section>
        <Favority />
      </div>
    );
  }
}

export default Amenu;
